window.bookSummaryJSON = "<p>Something boils inside of me, making me lose control.</p> <p>All throughout my childhood, I was complacent vying for my father’s approval. Of course, that never happened and I finally relinquished the fantasy when he attempted to kill my fated mate.</p> <p>Making matters worse, I learn that my life was a lie.</p> <p>The man who claims to be my father hunts me. After all, he has all the power and control. But I’m going to find myself and bring him to his knees...Or die trying.</p> <p>If you can't get enough of books by K.F. Breene, Kelly St. Claire, Annette Marie, Shannon Mayer, Leia Stone, Jaymin Eve, and Laura Thalassa, then you'll love this urban fantasy romance.</p> <p>Purchase <i>Awakened Magic</i> today.</p>"; 
